import React, { Component } from 'react';
import Layout from '../layouts/MainLayout';
import Cartitem from '../components/Cartitem';
import SubNavBar from '../layouts/SubNavbar';
import Footer from '../components/Footer';
import {Url} from './../constant/main';



class Index extends Component {

   

    showsidebar(){
        this.refs.child.showSidebar();
      }
    
    render() { 
        
        //side navbar link
        const sidenavlink = [
            {id:1,link:'/',linkname:'home'},
            {id:1,link:'/menu',linkname:'menu'},
            {id:1,link:'/',linkname:'menu2'},
            {id:1,link:'/',linkname:'menu3'},
            {id:1,link:'/',linkname:'menu4'},
            {id:1,link:'/',linkname:'menu5'},
          ];
          
            const sidenavconst = {topic : 'Categeries',topiclink:'All Categeriess',sidenavlink:sidenavlink};
        //////////////
          return ( 
            <Layout>
                <SubNavBar sidenavconst={sidenavconst}/>
                

                <Cartitem  topic="My favorites"></Cartitem>
            <Footer/>
                   </Layout>
           );
      }
    
}

Index.getInitialProps = async function(context) {

   // var data = Cookie.getJSON('faverite-item');
   // const { store, isServer, query, req } = context;
   
    const res = await fetch(`${Url}itemforfavorite?fav=`);
    var  items = await res.json();
    var error = false;
    if(res.status!=200){
        error = true ;
   }
   //console.log(items)
    return {error}


  }


export default Index;
